import React from 'react'

const DefinicoesPage = ({ sidebarMinimized, setSidebarMinimized }) => {
  return (
    <>
      <div className={`w-full h-full flex justify-center bg-zinc-300 dark:bg-gray-950`}>
        <div className='flex flex-col border-zinc-600 border-[1px] dark:border-zinc-200'>
            <h1 className='font-bold '>Perfil</h1>
        </div>
      </div>
      
    </>
  )
}

export default DefinicoesPage
